// SPDX-License-Identifier: MIT
pragma solidity >0.5.0 <0.8.0;
pragma experimental ABIEncoderV2;

/**
 * @title mockOVM_GenericCrossDomainMessenger
 * @dev An experimental alternative mock for local testing.
 */
contract mockOVM_GenericCrossDomainMessenger {
    address public xDomainMessageSender;

    event SentMessage(
        address _sender,
        address _target,
        bytes _message,
        uint256 _gasLimit
    );

    function sendMessage(
        address _target,
        bytes memory _message,
        uint32 _gasLimit
    )
        public
    {
        emit SentMessage(
            msg.sender,
            _target,
            _message,
            _gasLimit
        );
    }

    function relayMessage(
        address _sender,
        address _target,
        bytes memory _message,
        uint256 _gasLimit
    )
        public
    {
        xDomainMessageSender = _sender;
        _target.call{gas: _gasLimit}(_message);
        xDomainMessageSender = address(0);
    }
}

